- input: "TEXT\x1CC00277541\x1CX0\x1C\x1CF3XA\x1CThe Fairfax County Democratic Committee
    is an all volunteer committee with no paid staff of any kind. No other entities
    pay compensation for their employees to work for the committee either part time
    or full time. No payroll expenses are incurred. The committee maintains both Federal
    and non Federal accounts, and it has elected not to allocate its administrative
    expenses between accounts, so all administrative overhead expenses are paid 100
    percent with Federal funds. The Committee does not engage in any fundraising on
    behalf of candidates for Federal office, so all of its reported fund raising expenses
    are party fund raising.         This amendment is needed so that all 2008 reports
    are being filed with our new donor management software provided by NGP. The conversion
    to this new software in March 2008 corrupted accumulated expenses by line number
    in the later FEC monthly reports, created errors in classification of disbursement
    data imported from Quickbooks accounting software, and caused duplicate reporting
    of some of our fund raising expenses. Duplicate transactions have been removed
    and reported only once. Corrections were made to other disbursements as needed.
    These corrections should not be needed for reports filed in the future. "
